import React from "react";

function Item(props){
    console.log("item rendering");
    return(
        <div key={this.props.idx}>
            <div>idx : {this.props.idx}</div>
            <div>이름 : {this.props.user.name}</div>
            <div>나이 : {this.props.user.age}</div>
            <div>점수 : {this.props.user.score}</div>
            <div>등급 : {this.props.getResult(this.props.user.score).grade}</div>
        </div>
    );
}

export default Item;
